import React, { Component, Fragment } from "react";
import config from "../../app/config";
import {store} from "../../redux/storeConfig/store";
import ContentHeader from "../../components/contentHead/contentHeader";
import {Button, Card, CardBody, Col, FormGroup, Label, Row, Form, Input} from "reactstrap";
import {CheckSquare, X, Map, Edit} from "react-feather";
import {NavLink} from "react-router-dom";


class Show extends Component {

    state = {
        auth: store.getState().authentication.Auth,
        formValues: {
            booth_name: '',
            merchant_id: '',
            phone: null,
            full_address: ''
        }
    };

    componentWillMount() {
        this.getBooth();
    }

    getBooth = async () => {
        const { id } = this.props.match.params;
        const { formValues } = this.state;
        const requestOptions = {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json',
                "Authorization": `Bearer ${this.state.auth.token}`
            }
        };
        fetch(`${config.base_url}v1/booth/${id}`, requestOptions)
            .then(this.handleResponse)
            .then(response => {
                if(response.success === true){
                    const formValues = response.data.booth;
                    this.setState({formValues });
                }
                return response;
            });
    };

    handleResponse(response) {
        return response.text().then(text => {
            return text && JSON.parse(text);
        });
    }

    render() {
        const {formValues} = this.state;
        return (
            <Fragment>
                <ContentHeader>Booth Show </ContentHeader>

                <Row>
                    <Col md="12">
                        <Card>
                            <CardBody>
                                <div className="px-3">
                                    <Form id="vehicleForm">
                                        <div className="form-body">
                                            <h4 className="form-section"><Map size={20} color="#212529" /> Booth Info</h4>
                                            <Row>
                                                <Col md="6">
                                                    <FormGroup>
                                                        <Label for="booth_name">Booth Name</Label>
                                                        <Input name="booth_name" value={formValues.booth_name} disabled={true} id="booth_name" className={`form-control`}/>
                                                    </FormGroup>
                                                </Col>
                                                <Col md="6">
                                                    <FormGroup>
                                                        <Label for="type">Booth Merchant</Label>
                                                       {/* <select id="type" name="type" className={`form-control`} disabled={true}>
                                                            <option value="0" defaultValue="" disabled="">Select Type</option>
                                                            <option value="Car" selected={formValues.type === 'Car'}>Car</option>
                                                            <option value="Bus" selected={formValues.type === 'Bus'}>Bus</option>
                                                            <option value="Motor Bike" selected={formValues.type === 'Motor Bike'}>Motor Bike</option>
                                                        </select>*/}
                                                    </FormGroup>
                                                </Col>
                                            </Row>

                                            <Row>
                                                <Col md="6">
                                                    <FormGroup>
                                                        <Label for="make">Phone</Label>
                                                        <Input id="make" value="" disabled={true} name="make" className={`form-control`} />
                                                    </FormGroup>
                                                </Col>
                                                <Col md="6">
                                                    <FormGroup>
                                                        <Label for="model">Model</Label>
                                                        <Input name="model" value="" disabled={true} id="model" className={`form-control`} />
                                                    </FormGroup>
                                                </Col>
                                            </Row>


                                        </div>

                                        <div className="form-actions">
                                            <NavLink to={`/vehicles/edit/`} className="item" activeclassname="active">
                                                <Button color="warning" className="mr-1">
                                                    <Edit size={16} color="#FFF" /> Edit
                                                </Button>
                                            </NavLink>


                                        </div>
                                    </Form>
                                </div>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Fragment>
        );
    }
}

export default Show;
